import React from "react";
import './index.css';


const App=()=>{
  return(
    <>
    <h1>Hii this is from</h1>
    <form>
      <input type="text" 
      placeholder="Enter your First name" 
        name="fname"
        value=""
        onChange={InputEvent}
        autoComplete="off"
      />
      <input type="text" 
      placeholder="Enter your  Last name" 
        name="lname"
        value=""
        onChange={InputEvent}
        autoComplete="off"
      />
      <input type="text" 
      placeholder="Enter your Email" 
        name="Email"
        value=""
        onChange={InputEvent}
        autoComplete="off"
      />
      <input type="text" 
      placeholder="Enter yourpassword" 
        name="password"
        value=""
        onChange={InputEvent}
        autoComplete="off"
      />
    </form>
    </>
  );
}

export default App;
